import React from 'react';
import './App.css';
// import getToken from './api/OAuth';
import env from 'react-dotenv';

const App = () => {
  const handleOnClick = () => {
    // const token = getToken();
    alert("clicked");
  };

  return (
    <div className="App">
      <div>{env.BNET_ID}</div>
      <button
        onClick={handleOnClick}
      >Click Me</button>
    </div>
  );
};

export default App;
